import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { EmployeesCard } from "./components/EmployeesCard";
import { FiPlus } from "react-icons/fi";
import { NavLink } from "react-router-dom";
import { GirdAndListView } from "../../../../common/components/GirdAndListView/GirdAndListView";
import { BsCaretDownFill, BsCaretUpFill } from "react-icons/bs";

export const EmployeesManagement = () => {
  return (
    <>
      <div className="custom_container">
        <div className="row">
          <div className="col-xxl-9 col-xl-9 col-lg-9 col-md-6 col-sm-5 col-5">
            <TopPageTitle Name="Employeesâ€™ Management" />
          </div>
          <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-6 col-sm-7 col-7 MyAttendence_next_page">
            <NavLink to="/">
              <span>Add Employee</span>
              <FiPlus />
            </NavLink>
          </div>
        </div>

        <GirdAndListView
          GirdView={<EmployeesCard />}
          ListView={<EmployeesListView />}
        />
      </div>
    </>
  );
};
const EmployeesListView = () => {
  const IssueAssetsApp = (props) => {
    return (
      <>
        <tr>
          <td>{props.Salary}</td>
          <td>{props.Amount}</td>
          <td>{props.Fixed}</td>
          <td>{props.Taxable}</td>
        </tr>
      </>
    );
  };
  const IssueAssetsAppData = [
    {
      Salary: "Basic Salary",
      Amount: "112%",
      Fixed: "Percentage",
      Taxable: "Yes",
    },
    {
      Salary: "HRA",
      Amount: "112%",
      Fixed: "Percentage",
      Taxable: "Yes",
    },
    {
      Salary: "Special Allowance",
      Amount: "112%",
      Fixed: "Percentage",
      Taxable: "Fixed",
    },
    {
      Salary: "LTA",
      Amount: "112%",
      Fixed: "Percentage",
      Taxable: "Yes",
    },
  ];

  return (
    <>
      <div className="profile_iner_cont">
        <div className="row">
          <div className="col-12">
            <table className="table text-center IssueAssets_top_div">
              <thead>
                <tr>
                  <th scope="col">
                    <span className="new_application_table_filter_div">
                      Salary Component
                      <span className="new_application_table_filter">
                        <BsCaretUpFill />
                        <BsCaretDownFill />
                      </span>
                    </span>
                  </th>
                  <th scope="col">
                    <span className="new_application_table_filter_div">
                      %age of CTC or Amount
                      <span className="new_application_table_filter">
                        <BsCaretUpFill />
                        <BsCaretDownFill />
                      </span>
                    </span>
                  </th>
                  <th scope="col">
                    <span className="new_application_table_filter_div">
                      Percentage or Fixed
                      <span className="new_application_table_filter">
                        <BsCaretUpFill />
                        <BsCaretDownFill />
                      </span>
                    </span>
                  </th>
                  <th scope="col">
                    <span className="new_application_table_filter_div">
                      Taxable
                      <span className="new_application_table_filter">
                        <BsCaretUpFill />
                        <BsCaretDownFill />
                      </span>
                    </span>
                  </th>
                </tr>
              </thead>
              <tbody>
                {IssueAssetsAppData.map((val, i) => {
                  return (
                    <IssueAssetsApp
                      key={i}
                      Salary={val.Salary}
                      Amount={val.Amount}
                      Fixed={val.Fixed}
                      Taxable={val.Taxable}
                    />
                  );
                })}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
};
